import React from 'react';
import { slide as Menu } from 'react-burger-menu';
import './Sidebar.css';
import { Link } from "react-router-dom";

export default props => {
  return (
    <Menu>
      <a className="menu-item" to="/">
        Home
      </a>
      <a className="menu-item" to="/Education">
        Education
      </a>
      <a className="menu-item" to="/Experience">
        Experience
      </a>
      <a className="menu-item" to="/InterestsActivities">
        Interests & Activities
      </a>
    </Menu>
  );
};
